import React, { useState } from 'react';
import { Form ,Col, Container} from 'reactstrap';

function Admin() {

 

  const [showAddTourDetails, setShowAddTourDetails] = useState(true);
  

  function handleAddTourButtonClick() {
    setShowAddTourDetails(true);
  }

  function handleDeleteTourButtonClick() {
    setShowAddTourDetails(false);
  }
  
  

  return (
    <Container>
        <Col>
    <div>
      <h1>Tour Details Page</h1>
      {showAddTourDetails ? <AddTourDetailsForm /> : <DeleteTourDetailsButton />}
      <div>
        <button onClick={handleAddTourButtonClick}>Add Tour Details</button>
        <button onClick={handleDeleteTourButtonClick}>Delete Tour Details</button>
      </div>
    </div>
    </Col>
    </Container>
  );
}

function AddTourDetailsForm() {
  // Render the form to add tour details
  const handleChange = e => {
    setShowAddTourDetails(prev=>({...prev, [e.target.id]:e.target.value}))
};

const [title, setTitle] = useState('');
  const [city, setCity] = useState('');
  const [address, setAddress] = useState('');
  const [distance, setDistance] = useState(0);
  const [price, setPrice] = useState(0);
  const [maxGroupSize, setMaxGroupSize] = useState(0);
  const [desc, setDesc] = useState('');
  const [photo, setPhoto] = useState('');
  const [featured, setFeatured] = useState(false);

  function handleSubmit(event) {
    event.preventDefault();
    const ShowAddTourDetails = {
      title,
      city,
      address,
      distance,
      price,
      maxGroupSize,
      desc,
      reviews: [],
      photo,
      featured,
    };
    // do something with the tourDetails object, such as submitting it to a backend API
  }

  return (
    <div>
      <h2>Add Tour Details</h2>
      {/* Add form fields and submit button */}
      <Form onSubmit={handleSubmit}> 
      <label>
        Title:
        <input type="text" value={title} onChange={(event) => setTitle(event.target.value)} />
      </label>
      <label>
        City:
        <input type="text" value={city} onChange={(event) => setCity(event.target.value)} />
      </label>
      <label>
        Address:
        <input type="text" value={address} onChange={(event) => setAddress(event.target.value)} />
      </label>
      <label>
        Distance:
        <input type="number" value={distance} onChange={(event) => setDistance(event.target.value)} />
      </label>
      <label>
        Price:
        <input type="number" value={price} onChange={(event) => setPrice(event.target.value)} />
      </label>
      <label>
        Max group size:
        <input type="number" value={maxGroupSize} onChange={(event) => setMaxGroupSize(event.target.value)} />
      </label>
      <label>
        Description:
        <textarea value={desc} onChange={(event) => setDesc(event.target.value)} />
      </label>
      <label>
        Photo:
        <input type="text" value={photo} onChange={(event) => setPhoto(event.target.value)} />
      </label>
      <label>
        Featured:
        <input type="checkbox" checked={featured} onChange={(event) => setFeatured(event.target.checked)} />
      </label>
      <button type="submit">Submit</button>
    
      </Form> 
      
    </div>
  );
}

function DeleteTourDetailsButton() {
  // Render the button to delete tour details
  return (
    <div>
      <h2>Delete Tour Details</h2>
      <button>Delete Tour</button>
    </div>
  );
}



export default Admin;
